  true,\n\t\"url\": null,\n\t\"notes\": \"Effective January 1, 2015, an individual
  who qualifies as a permit consultant under San Francisco law must register and file
  quarterly reports with the Ethics Commission.A permit consultant is an individual
  who receives or is promised compensation to provide permit consulting services on
  a ufffdufffdufffdmajor projectufffdu06dd or a ufffdufffdufffdminor project,ufffdu06dd
  including any employee who receives compensation for time spent on permit consulting
  services. ufffdufffdufffdPermit consulting servicesufffdu06dd means any contact
  with the Department of Building Inspection, the Entertainment Commission, the Planning
  Department, or the Department of Public Works to help a permit applicant obtain
  a permit.  ufffdufffdufffdPermit consulting servicesufffdu06dd do not include simple
  requests for information which do not otherwise include attempts to help obtain
  a permit.A ufffdufffdufffdmajor projectufffdu06dd is a real estate development project
  located in the City and County of San Francisco with estimated construction costs
  exceeding $1,000,000 and which requires a permit issued by the Department of Building
  Inspection or the Planning Department.   Estimated constructions costs are to be
  calculated in the same manner used to determine building permit fees under the Building
  Code. A ufffdufffdufffdminor projectufffdu06dd is a project located in the City
  and County of San Francisco which requires a permit issued by the Entertainment
  Commission.The following individuals are not permit consultants and thus are not
  required to register or report:-a licensed architect or engineer of record for construction
  activity allowed or contemplated by the permit, or an employee of that architect
  or engineer;-a contractor who will be responsible for all construction activity
  associated with the requested permit, or an employee of that contractor; or-an employee
  or agent of an organization with tax exempt status under 26 United States Code Section
  501(c)(3) communicating on behalf of that organization regarding the development
  of a project for that organization. Each permit consultant must register with the
  Ethics Commission no later than five business days after providing permit consulting
  services.  Quarterly disclosure reports must subsequently be filed with the Ethics
  Commission.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
